def process_events(event):
    result = {}
    result['id'] = event['id']
    result['type'] = event['type']
    result['public'] = event['public']
    result['created_at'] = event['created_at']

    result['actor__id'] = event['actor']['id']
    result['actor__login'] = event['actor']['login']
    return result

